     dojo.query("span.txt:contains('Portal Users')").parent().parent().parent().parent().parent().forEach(function(node, index, array) { dojo.style(node, "display", ""); });
    });
    dojo.query("span.txt:contains('Administrators')").parent().parent().parent().parent().parent().forEach(function(node, index, array) { dojo.style(node, "display", "none"); });
